def ReverseComplement(Pattern):
    revComp = map(complement, Pattern)
    return ('').join(revComp)[::-1]

# Complement of nucleotide

def complement(Nucleotide):
    complements = { 'A': 'T', 'T' : 'A', 'G' : 'C', 'C' : 'G'}
    comp = complements[Nucleotide.upper()] 
    return comp

