#reverse complement: flip string and replace letter to complement 
dna = "TGCCAAGTAC"
def reverse_complement(dna):
    complement = {'A': 'T', 'C': 'G', 'G': 'C', 'T': 'A'}
    return ''.join([complement[base] for base in dna[::-1]])
print (reverse_complement(dna))
